import React from 'react';
import './ProfilePage.css';

const ProfilePage = () => {
  return (
    <div className="profile-page">
      <h1>Profile</h1>
      <p>This page will display your profile (placeholder)</p>
    </div>
  );
};

export default ProfilePage;
